To build a PyO3-based Python extension manually, start by running cargo build as normal in a library project which uses PyO3's extension-module feature and has the cdylib crate type . Once built, symlink (or copy) and rename the shared library from Cargo's target/ directory to your desired output directory: on macOS, rename libyour_module.dylib to your_module.so. on Windows, rename libyour_module.dll to your_module.pyd. on Linux, rename libyour_module.so to your_module.so. You can then open a Python shell in the output directory and you'll be able to run import your_module. See, as an example, Bazel rules to build PyO3 on Linux at https://github.com/TheButlah/rules_pyo3. macOS On macOS, because the extension-module feature disables linking to libpython ( see the next section ), some additional linker arguments need to be set. maturin and setuptools-rust both pass these arguments for PyO3 automatically, but projects using manual builds will need to set these directly in order to support macOS. The easiest way to set the correct linker arguments is to add a build.rs with the following content: fn main() { pyo3_build_config::add_extension_module_link_args();
} Remember to also add pyo3-build-config to the build-dependencies section in Cargo.toml. An alternative to using pyo3-build-config is add the following to a cargo configuration file (e.g. .cargo/config.toml): [target.x86_64-apple-darwin]
rustflags = [ "-C", "link-arg=-undefined", "-C", "link-arg=dynamic_lookup",
] [target.aarch64-apple-darwin]
rustflags = [ "-C", "link-arg=-undefined", "-C", "link-arg=dynamic_lookup",
]

