For most projects, it's adequate to centralize all your FFI code into a single Rust module. However, for larger projects, it can be helpful to split your Rust code into several Rust modules to keep your code readable. Unfortunately, though, some of the macros like wrap_pyfunction! do not yet work when used on code defined in other modules ( #1709 ). One way to work around this is to pass references to the PyModule so that each module registers its own FFI code. For example: // src/lib.rs
use pyo3::prelude::*; #[pymodule]
fn my_extension(py: Python, m: &PyModule) -> PyResult<()> { dirutil::register(py, m)?; osutil::register(py, m)?; Ok(())
} // src/dirutil.rs
# mod dirutil {
use pyo3::prelude::*; pub(crate) fn register(py: Python, m: &PyModule) -> PyResult<()> { m.add_class::<SomeClass>()?; Ok(())
} #[pyclass]
struct SomeClass { x: usize,
}
# } // src/osutil.rs
# mod osutil {
use pyo3::prelude::*; pub(crate) fn register(py: Python, m: &PyModule) -> PyResult<()> { m.add_function(wrap_pyfunction!(determine_current_os, m)?)?; Ok(())
} #[pyfunction]
fn determine_current_os() -> String { "linux".to_owned()
}
# } Another workaround for splitting FFI code across multiple modules ( #1709 ) is to add use module::*, like this: // src/lib.rs
use pyo3::prelude::*;
use osutil::*; #[pymodule]
fn my_extension(py: Python, m: &PyModule) -> PyResult<()> { m.add_function(wrap_pyfunction!(determine_current_os, m)?)?; Ok(())
} // src/osutil.rs
# mod osutil {
use pyo3::prelude::*; #[pyfunction]
pub(crate) fn determine_current_os() -> String { "linux".to_owned()
}
# }

