You can create a module hierarchy within a single extension module by using PyModule.add_submodule() . For example, you could define the modules parent_module and parent_module.child_module. use pyo3::prelude::*; #[pymodule]
fn parent_module(py: Python, m: &PyModule) -> PyResult<()> { register_child_module(py, m)?; Ok(())
} fn register_child_module(py: Python, parent_module: &PyModule) -> PyResult<()> { let child_module = PyModule::new(py, "child_module")?; child_module.add_function(wrap_pyfunction!(func, child_module)?)?; parent_module.add_submodule(child_module)?; Ok(())
} #[pyfunction]
fn func() -> String { "func".to_string()
} # Python::with_gil(|py| {
# use pyo3::wrap_pymodule;
# use pyo3::types::IntoPyDict;
# let parent_module = wrap_pymodule!(parent_module)(py);
# let ctx = [("parent_module", parent_module)].into_py_dict(py);
#
# py.run("assert parent_module.child_module.func() == 'func'", None, Some(&ctx)).unwrap();
# }) Note that this does not define a package, so this won’t allow Python code to directly import submodules by using from parent_module import child_module. For more information, see #759 and #1517 . It is not necessary to add #[pymodule] on nested modules, which is only required on the top-level module.

