PyO3 supports two ways to define a free function in Python. Both require registering the function to a module . One way is annotating a function with #[pyfunction] and then adding it to the module using the wrap_pyfunction! macro. use pyo3::prelude::*; #[pyfunction]
fn double(x: usize) -> usize { x * 2
} #[pymodule]
fn my_extension(py: Python, m: &PyModule) -> PyResult<()> { m.add_function(wrap_pyfunction!(double, m)?)?; Ok(())
} Alternatively, there is a shorthand: the function can be placed inside the module definition and annotated with #[pyfn], as below: use pyo3::prelude::*; #[pymodule]
fn my_extension(py: Python, m: &PyModule) -> PyResult<()> { #[pyfn(m)] fn double(x: usize) -> usize { x * 2 } Ok(())
} #[pyfn(m)] is just syntactic sugar for #[pyfunction], and takes all the same options documented in the rest of this chapter. The code above is expanded to the following: use pyo3::prelude::*; #[pymodule]
fn my_extension(py: Python, m: &PyModule) -> PyResult<()> { #[pyfunction] fn double(x: usize) -> usize { x * 2 } m.add_function(wrap_pyfunction!(double, m)?)?; Ok(())
}

