Here we have the same async function as before written in Rust using the async-std runtime: /// Sleep for 1 second
async fn rust_sleep() { async_std::task::sleep(std::time::Duration::from_secs(1)).await;
} Similar to Python, Rust's async functions also return a special object called a Future: let future = rust_sleep(); We can convert this Future object into Python to make it awaitable. This tells Python that you can use the await keyword with it. In order to do this, we'll call pyo3_asyncio::async_std::future_into_py : use pyo3::prelude::*; async fn rust_sleep() { async_std::task::sleep(std::time::Duration::from_secs(1)).await;
} #[pyfunction]
fn call_rust_sleep(py: Python) -> PyResult<&PyAny> { pyo3_asyncio::async_std::future_into_py(py, async move { rust_sleep().await; Ok(Python::with_gil(|py| py.None())) })
} In Python, we can call this pyo3 function just like any other async function: from example import call_rust_sleep async def rust_sleep(): await call_rust_sleep()

