You may have a nested struct similar to this: # use pyo3::prelude::*;
#[pyclass]
#[derive(Clone)]
struct Inner { /* fields omitted */ } #[pyclass]
struct Outer { #[pyo3(get)] inner: Inner,
} #[pymethods]
impl Outer { #[new] fn __new__() -> Self { Self { inner: Inner {} } }
} When Python code accesses Outer's field, PyO3 will return a new object on every access (note that their addresses are different): outer = Outer() a = outer.inner
b = outer.inner assert a is b, f"a: {a}\nb: {b}" AssertionError: a: <builtins.Inner object at 0x00000238FFB9C7B0>
b: <builtins.Inner object at 0x00000238FFB9C830> This can be especially confusing if the field is mutable, as getting the field and then mutating it won't persist - you'll just get a fresh clone of the original on the next access. Unfortunately Python and Rust don't agree about ownership - if PyO3 gave out references to (possibly) temporary Rust objects to Python code, Python code could then keep that reference alive indefinitely. Therefore returning Rust objects requires cloning. If you don't want that cloning to happen, a workaround is to allocate the field on the Python heap and store a reference to that, by using Py<...> : # use pyo3::prelude::*;
#[pyclass]
#[derive(Clone)]
struct Inner { /* fields omitted */ } #[pyclass]
struct Outer { #[pyo3(get)] inner: Py<Inner>,
} #[pymethods]
impl Outer { #[new] fn __new__(py: Python) -> PyResult<Self> { Ok(Self { inner: Py::new(py, Inner {})?, }) }
} This time a and b are the same object: outer = Outer() a = outer.inner
b = outer.inner assert a is b, f"a: {a}\nb: {b}"
print(f"a: {a}\nb: {b}") a: <builtins.Inner object at 0x0000020044FCC670>
b: <builtins.Inner object at 0x0000020044FCC670> The downside to this approach is that any Rust code working on the Outer struct now has to acquire the GIL to do anything with its field.

