Some protocol (aka __dunder__) methods such as __bytes__ and __format__ have been possible to implement two ways in PyO3 for some time: via a #[pyproto] (e.g. PyBasicProtocol for the methods listed here), or by writing them directly in #[pymethods]. This is only true for a handful of the #[pyproto] methods (for technical reasons to do with the way PyO3 currently interacts with the Python C-API). In the interest of having onle one way to do things, the #[pyproto] forms of these methods have been deprecated. To migrate just move the affected methods from a #[pyproto] to a #[pymethods] block. Before: use pyo3::prelude::*;
