struct MyClass { } #[pyproto]
impl PyBasicProtocol for MyClass { fn __bytes__(&self) -> &'static [u8] { b"hello, world" }
} After: use pyo3::prelude::*; #[pyclass]
struct MyClass { } #[pymethods]
impl MyClass { fn __bytes__(&self) -> &'static [u8] { b"hello, world" }
