Because #[pyclass] structs can be sent between threads by the Python interpreter, they must implement Send or declared as unsendable (by #[pyclass(unsendable)]). Note that unsendable is added in PyO3 0.11.1 and Send is always required in PyO3 0.11.0. This may "break" some code which previously was accepted, even though it could be unsound. There can be two fixes: If you think that your #[pyclass] actually must be Sendable, then let's implement Send. A common, safer way is using thread-safe types. E.g., Arc instead of Rc, Mutex instead of RefCell, and Box<dyn Send + T> instead of Box<dyn T>. Before: use pyo3::prelude::*;
use std::rc::Rc;
use std::cell::RefCell; #[pyclass]
struct NotThreadSafe { shared_bools: Rc<RefCell<Vec<bool>>>, closure: Box<dyn Fn()>
} After: use pyo3::prelude::*;
use std::sync::{Arc, Mutex}; #[pyclass]
struct ThreadSafe { shared_bools: Arc<Mutex<Vec<bool>>>, closure: Box<dyn Fn() + Send>
} In situations where you cannot change your #[pyclass] to automatically implement Send (e.g., when it contains a raw pointer), you can use unsafe impl Send. In such cases, care should be taken to ensure the struct is actually thread safe. See the Rustnomicon for more. If you think that your #[pyclass] should not be accessed by another thread, you can use unsendable flag. A class marked with unsendable panics when accessed by another thread, making it thread-safe to expose an unsendable object to the Python interpreter. Before: use pyo3::prelude::*; #[pyclass]
struct Unsendable { pointers: Vec<*mut std::os::raw::c_char>,
} After: use pyo3::prelude::*; #[pyclass(unsendable)]
struct Unsendable { pointers: Vec<*mut std::os::raw::c_char>,
}

