In order to make the function signature available to Python to be retrieved via inspect.signature, use the #[pyo3(text_signature)] annotation as in the example below. The / signifies the end of positional-only arguments. (This is not a feature of this library in particular, but the general format used by CPython for annotating signatures of built-in functions.) use pyo3::prelude::*; /// This function adds two unsigned 64-bit integers.
