Iterators can be defined using the PyIterProtocol trait. It includes two methods __iter__ and __next__: fn __iter__(slf: PyRefMut<Self>) -> PyResult<impl IntoPy<PyObject>> fn __next__(slf: PyRefMut<Self>) -> PyResult<Option<impl IntoPy<PyObject>>> Returning None from __next__ indicates that that there are no further items. These two methods can be take either PyRef<Self> or PyRefMut<Self> as their first argument, so that mutable borrow can be avoided if needed. Example: use pyo3::prelude::*;
use pyo3::PyIterProtocol; #[pyclass]
struct MyIterator { iter: Box<Iterator<Item = PyObject> + Send>,
} #[pyproto]
impl PyIterProtocol for MyIterator { fn __iter__(slf: PyRef<Self>) -> PyRef<Self> { slf } fn __next__(mut slf: PyRefMut<Self>) -> Option<PyObject> { slf.iter.next() }
} In many cases you'll have a distinction between the type being iterated over (i.e. the iterable ) and the iterator it provides. In this case, you should implement PyIterProtocol for both the iterable and the iterator, but the iterable only needs to support __iter__() while the iterator must support both __iter__() and __next__(). The default implementations in PyIterProtocol will ensure that the objects behave correctly in Python. For example: # use pyo3::prelude::*;
