The easiest way to convert a Python object to a Rust value is using .extract(). It returns a PyResult with a type error if the conversion fails, so usually you will use something like let v: Vec<i32> = obj.extract()?; This method is available for many Python object types, and can produce a wide variety of Rust types, which you can check out in the implementor list of FromPyObject . FromPyObject is also implemented for your own Rust types wrapped as Python objects (see the chapter about classes ). There, in order to both be able to operate on mutable references and satisfy Rust's rules of non-aliasing mutable references, you have to extract the PyO3 reference wrappers PyRef and PyRefMut . They work like the reference wrappers of std::cell::RefCell and ensure (at runtime) that Rust borrows are allowed. Deriving FromPyObject FromPyObject can be automatically derived for many kinds of structs and enums if the member types themselves implement FromPyObject. This even includes members with a generic type T: FromPyObject. Derivation for empty enums, enum variants and structs is not supported. Deriving FromPyObject for structs use pyo3::prelude::*; #[derive(FromPyObject)]
struct RustyStruct { my_string: String,
} The derivation generates code that will per default access the attribute my_string on the Python object, i.e. obj.getattr("my_string"), and call extract() on the attribute. It is also possible to access the value on the Python object through obj.get_item("my_string") by setting the attribute pyo3(item) on the field: use pyo3::prelude::*; #[derive(FromPyObject)]
struct RustyStruct { #[pyo3(item)] my_string: String,
} The argument passed to getattr and get_item can also be configured: use pyo3::prelude::*; #[derive(FromPyObject)]
struct RustyStruct { #[pyo3(item("key"))] string_in_mapping: String, #[pyo3(attribute("name"))] string_attr: String,
} This tries to extract string_attr from the attribute name and string_in_mapping from a mapping with the key "key". The arguments for attribute are restricted to non-empty string literals while item can take any valid literal that implements ToBorrowedObject. Deriving FromPyObject for tuple structs Tuple structs are also supported but do not allow customizing the extraction. The input is always assumed to be a Python tuple with the same length as the Rust type, the nth field is extracted from the nth item in the Python tuple. use pyo3::prelude::*; #[derive(FromPyObject)]
struct RustyTuple(String, String); Tuple structs with a single field are treated as wrapper types which are described in the following section. To override this behaviour and ensure that the input is in fact a tuple, specify the struct as use pyo3::prelude::*; #[derive(FromPyObject)]
struct RustyTuple((String,)); Deriving FromPyObject for wrapper types The pyo3(transparent) attribute can be used on structs with exactly one field. This results in extracting directly from the input object, i.e. obj.extract(), rather than trying to access an item or attribute. This behaviour is enabled per default for newtype structs and tuple-variants with a single field. use pyo3::prelude::*; #[derive(FromPyObject)]
struct RustyTransparentTupleStruct(String); #[derive(FromPyObject)]
#[pyo3(transparent)]
